svg.script:
(function () {
  "use strict";

  function init(){
    var smallProfile1 = document.getElementById('Group_3284_1_');
    var smallProfile2 = document.getElementById('Group_3284');
    var smallProfile3 = document.getElementById('Group_3285');
    var smallProfile4 = document.getElementById('Group_3285_2');
    var bigProfile = document.getElementById('Group_3286');
    var robotBrain = document.getElementById('Path_6591');
    var robotArm = document.getElementById('arm');

    var tl1 = new TimelineMax({repeat:-1});
    var tl2 = new TimelineMax({repeat:-1, delay:1.0});
    var tl3 = new TimelineMax({repeat:-1, delay:2});
    var tl4 = new TimelineMax({repeat:-1, delay:3});
    var tl5 = new TimelineMax({repeat:-1, delay:3});

    tl1.set(smallProfile1, {y:250, autoAlpha:0});
    tl2.set(smallProfile2, {y:250, autoAlpha:0});
    tl3.set(smallProfile3, {y:250, autoAlpha:0});
    tl4.set(smallProfile4, {y:250, autoAlpha:0});

    tl1.to(smallProfile1, 4, {y:'-=350', ease:Power0.easeNone}, 0);
    tl1.to(smallProfile1, 1, {autoAlpha:1}, 0);
    tl1.to(smallProfile1, 1, {autoAlpha:0}, 3);

    tl2.to(smallProfile2, 4, {y:'-=350', ease:Power0.easeNone}, 0);
    tl2.to(smallProfile2, 1, {autoAlpha:1}, 0);
    tl2.to(smallProfile2, 1, {autoAlpha:0}, 3);

    tl3.to(smallProfile3, 4, {y:'-=350', ease:Power0.easeNone}, 0);
    tl3.to(smallProfile3, 1, {autoAlpha:1}, 0);
    tl3.to(smallProfile3, 1, {autoAlpha:0}, 3);

    tl4.to(smallProfile4, 4, {y:'-=350', ease:Power0.easeNone}, 0);
    tl4.to(smallProfile4, 1, {autoAlpha:1}, 0);
    tl4.to(smallProfile4, 1, {autoAlpha:0}, 3);

    tl5.set(bigProfile, {autoAlpha:0}).to(bigProfile, .5, {autoAlpha:1}).to({}, 3, {}).to(bigProfile, .2, {autoAlpha:0}).to({}, 4, {});

    new TimelineMax().to(robotBrain, .1, {fill:'#40a1ff'}).to(robotBrain, .5, {fill:'#99b0b7'}).repeat(-1);
    new TimelineMax().set(robotArm, {transformOrigin:'4% 70%'}).to(robotArm, .7, {rotation:15, delay:.8}).to(robotArm, .2, {rotation:0, delay:2}).repeat(-1);

  }

  window.addEventListener('load', init);
}());
